import { config } from '@gluestack-ui/config';
import { NavigationContainer } from '@react-navigation/native';
import { useNavigation } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { DrawerContent, DrawerItem, createDrawerNavigator } from '@react-navigation/drawer';
import categorias from './components/Inicio';
import configuracion_usuario from './components/configuracion_usuario';
import { Button, Headline } from 'react-native-paper';
import React, { useState } from 'react';
import { View, Text, TouchableOpacity, StyleSheet, StatusBar } from 'react-native';
import { GluestackUIProvider } from '@gluestack-ui/themed';

import { ThemeProvider } from './theme'; // Ajusta la ruta según donde esté tu ThemeProvider
import ScreenWithTheme from './ScreenWithTheme'; // Reemplaza esto con tus componentes reales


const Drawer = createDrawerNavigator();


export default function App() {

  return( 
    <><ThemeProvider>
      <ScreenWithTheme />
    </ThemeProvider><NavigationContainer>
        <GluestackUIProvider config={config}>

          <Drawer.Navigator initialRouteName="Home">

            <Drawer.Screen name="Inicio" component={categorias} />
            <Drawer.Screen name="Configuracion" component={configuracion_usuario} />

          </Drawer.Navigator>



        </GluestackUIProvider>
      </NavigationContainer></>);


};
